import styled from "styled-components";

export const Div = styled.div`
  width: 100vw;
  padding: 5px;
  background: #000;
`;

export const Input = styled.input`
  width: 80%;
  background: #595959;
  color: #eee;
  padding: 5px 10px;
  margin: 0 10px;
  border-radius: 5px;
  border: none;
  &:focus{
    outline: none;
  }
`;
